exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.9itan.com/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="ml_list"[^>]*>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};